/* User-visible API */

/* parserCloudlex_init is special because it creates the scanner itself, so it is
 * the ONLY reentrant function that doesn't take the scanner as the last argument.
 * That's why we explicitly handle the declaration, instead of using our macros.
 */

int parserCloudlex_init(yyscan_t* ptr_yy_globals)

{
    if (ptr_yy_globals == nullptr){
        errno = EINVAL;
        return 1;
    }

    *ptr_yy_globals = (yyscan_t) parserCloudalloc ( sizeof( struct yyguts_t ), nullptr );

    if (*ptr_yy_globals == nullptr){
        errno = ENOMEM;
        return 1;
    }

    /* By setting to 0xAA, we expose bugs in yy_init_globals. Leave at 0x00 for releases. */
    memset(*ptr_yy_globals,0x00,sizeof(struct yyguts_t));

    return yy_init_globals ( *ptr_yy_globals );
}

/* parserCloudlex_init_extra has the same functionality as parserCloudlex_init, but follows the
 * convention of taking the scanner as the last argument. Note however, that
 * this is a *pointer* to a scanner, as it will be allocated by this call (and
 * is the reason, too, why this function also must handle its own declaration).
 * The user defined value in the first argument will be available to parserCloudalloc in
 * the yyextra field.
 */

int parserCloudlex_init_extra(YY_EXTRA_TYPE yy_user_defined,yyscan_t* ptr_yy_globals )

{
    struct yyguts_t dummy_yyguts;

    parserCloudset_extra (yy_user_defined, &dummy_yyguts);

    if (ptr_yy_globals == nullptr){
        errno = EINVAL;
        return 1;
    }
	
    *ptr_yy_globals = (yyscan_t) parserCloudalloc ( sizeof( struct yyguts_t ), &dummy_yyguts );
	
    if (*ptr_yy_globals == nullptr){
        errno = ENOMEM;
        return 1;
    }
    
    /* By setting to 0xAA, we expose bugs in
    yy_init_globals. Leave at 0x00 for releases. */
    memset(*ptr_yy_globals,0x00,sizeof(struct yyguts_t));
    
    parserCloudset_extra (yy_user_defined, *ptr_yy_globals);
    
    return yy_init_globals ( *ptr_yy_globals );
}

